import "./App.css"
import Dashboard from "./components/Dashboard"
import CircularProgress from "@material-ui/core/CircularProgress"
import { useEffect, useState } from "react"

import { getTickets } from "./utils/api-client"
import { Tickets } from "./models/types"

function App() {
  const [data, setData] = useState({} as Tickets)

  const getDashboardData = async () => {
    const result = await getTickets()

    setData((result as any))
  }

  useEffect(() => {
    getDashboardData()
  }, [])

  console.log(data)
  return (
    <div>
      <Dashboard tickets={data as Tickets} /> <CircularProgress />
    </div>
  )
}

export default App
